import './styles/App.css';
import Menu from './pages/Menu';
import Logo from './pages/Logo';
import {BrowserRouter, createBrowserRouter, Link, Route} from "react-router-dom";
import AboutMe from "./pages/AboutMe";
import Projects from "./pages/Projects";
import NoPage from "./pages/NoPage";
import Links from "./pages/Links";
import {StaticRouterProvider} from "react-router-dom/server";


const router = createBrowserRouter(
    {path: "/", element: <Menu/>, errorElement: <NoPage/>,
        children: [
            {index: true, element: <Logo/>},
            {path: "about_me", element: <AboutMe/>, errorElement: <NoPage/>},
            {path: "projects", element: <Projects/>, errorElement: <NoPage/>},
            {path: "links", element: <Links/>, errorElement: <NoPage/>},
            {path: "*", element: <NoPage/>, errorElement: <NoPage/>}
        ]}
);

function App() {
  return (
      <StaticRouterProvider router={router}/>
  );
}

export default App;
